import styles from "../App.css"
import background_image from "../images/background.png";
import logoImage from "../images/logo.svg";
import gifImage from "../images/gif.gif";
import NavBar from "../NavBar";
import TransitionBtn from "../TransitionBtn";

function Home() {

    return (
        <div className="Home"  style={{ 
          // perspective: "1px",
          // transformStyle: "preserve-3d",
          // overflowY:"scroll",
          // overflowX:"hidden",
          position:"relative",
          height: "100vh",
          // marginTop:"-50px"
        }}>
               <TransitionBtn navUrl="About"/>

          <div className="logoWrapper" style={{
            display:"flex",

            width:"100%",
            height:"50%",
            justifyContent:"space-around",
            background:"transparent",
            marginTop:"15%",
          }}
          >

            <div className="leftLogo" style={{ 
              display:"flex",
              alignItems:"center", 
              height:"100%",
              lineHeight:"100%", 

            }} data-scroll-item-id="slow">
              <img src={logoImage} style={{

                position: "relative",
                filter: "drop-shadow(0px, 4px, 4px, rgba(0, 0, 0, 0.25))",
              }}> 
              </img>
            </div>


            <div className="rightGif"      
                data-aos="fade-left"
                data-aos-delay="50"
                data-aos-duration="1500"
                data-aos-easing="ease-in-out"
                data-scroll-item-id="fast"
          style={{
              display:"flex",
              alignItems:"center", 


            }}> 
              <img src={gifImage} alt="gif loading" style={{
                width:"120%",
                position: "sticky",
                top:0,
                scale:"2"
                // transform: "translateZ(-3px)",

              }} />
            </div>
          </div>
        </div>


      );
}
export default Home;
